  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Pea Island
  NWR outlines Refuge accomplishments during the 1967 calendar year. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover conditions during the year. Wildlife- including migratory birds,
  upland game birds, furbearers, raptors, fish, and diseases- is also covered. The
  Refuge development and maintenance section discusses physical developments, plantings,
  collections and receipts, vegetation control, and wildfires. A progress report on
  field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, violations, and safety. Items of interest, N-R forms, and photographs are
  attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
